import React from 'react';
import "semantic-ui-css/semantic.min.css";

import { Header, Table, Grid, Checkbox, Button, Icon} from "semantic-ui-react";

class App extends React.Component {
  render() {
    return (
      // <Table celled definition>
      //   <Table.Header>
      //     <Table.Row>
      //       <Table.HeaderCell rowSpan='4'/>
      //       <Table.HeaderCell colSpan='3'>Month</Table.HeaderCell>
      //     </Table.Row>
      //     <Table.Row>
      //       <Table.HeaderCell colSpan='3'>Amounts</Table.HeaderCell>
      //     </Table.Row>
      //     <Table.Row>
      //       <Table.HeaderCell colSpan='3'>Overbudgeted</Table.HeaderCell>
      //     </Table.Row>
      //     <Table.Row>
      //       <Table.HeaderCell>Budgeted</Table.HeaderCell>
      //       <Table.HeaderCell>Spent</Table.HeaderCell>
      //       <Table.HeaderCell>Balance</Table.HeaderCell>
      //     </Table.Row>
      //   </Table.Header>
      //   <Table.Body>
      //     <Table.Row>
      //       <Table.Cell>Groceries</Table.Cell>
      //       <Table.Cell>200</Table.Cell>
      //       <Table.Cell>-57.68</Table.Cell>
      //       <Table.Cell>142.32</Table.Cell>
      //     </Table.Row>
      //   </Table.Body>
      // </Table>

      <div className="App">
        <Grid padded className="tablet computer only">
          <Menu borderless fluid inverted size="huge">
            <Container>
              <Menu.Item header as="a" href="#root">
                Project Name
              </Menu.Item>
              <Menu.Item active as="a" href="#root">
                Home
              </Menu.Item>
              <Menu.Item as="a" href="#root">
                About
              </Menu.Item>
              <Menu.Item as="a" href="#root">
                Contact
              </Menu.Item>
            </Container>
          </Menu>
        </Grid>
        <Grid padded className="mobile only">
          <Menu borderless fluid inverted size="huge">
            <Menu.Item header as="a" href="#root">
              Project Name
            </Menu.Item>
            <Menu.Menu position="right">
              <Menu.Item>
                <Button
                  icon
                  inverted
                  basic
                  toggle
                  onClick={this.handleToggleDropdownMenu}
                >
                  <Icon name="content" />
                </Button>
              </Menu.Item>
            </Menu.Menu>
            <Menu
              borderless
              fluid
              inverted
              vertical
              style={this.state.dropdownMenuStyle}
            >
              <Menu.Item active as="a" href="#root">
                Home
              </Menu.Item>
              <Menu.Item as="a" href="#root">
                About
              </Menu.Item>
              <Menu.Item as="a" href="#root">
                Contact
              </Menu.Item>
            </Menu>
          </Menu>
        </Grid>
        <Container text textAlign="center">
          <Header size="huge">Semantic-UI starter template</Header>
          <p className="lead">
            Use this document as a way to quickly start any new project.
          </p>
          <p className="lead">
            All you get is this text and a mostly barebones HTML document.
          </p>
        </Container>
      </div>
    );
  }
}

export default App;
